import './App.scss';
import Header from './components/Header/Header.jsx';
import { useEffect } from 'react';

const App = () => {
	useEffect(() => {
		const userData = JSON.parse(localStorage.getItem('userData'));
		console.log(userData);
	}, []);

	return (
		<div className='app'>
			<Header />
		</div>
	);
};

export default App;
